import React, { Component } from "react";
import { observer } from "mobx-react";

const App = observer(
  class App extends Component {
    filter = e => {
      this.props.store.filter = e.target.value;
    };
    render() {
      let { filter, todos } = this.props.store;
      let todoLis = todos.map((todo, index) => <li key={index}>{todo}</li>);
      return (
        <div className="App">
          <h1>{filter}</h1>
          <input
            type="text"
            value={this.props.store.filter}
            onChange={this.filter}
          />
          <h1>ToDos</h1>
          <ul>{todoLis}</ul>
          <h1>{this.props.store.dummy}</h1>
        </div>
      );
    }
  }
);

export default App;
